### JavaScript

```javascript
"use strict";

function f_gold(x, y, bound) {
    let s = new Set();
    let i = 1;
    while (i < bound) {
        let j = 1;
        while (j < bound) {
            if (i + j <= bound) {
                s.add(i + j);
            }
            if (y === 1) {
                break;
            }
            j *= y;
        }
        if (x === 1) {
            break;
        }
        i *= x;
    }
    return Array.from(s);
}
```
